// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract SupplyChain is Ownable, ReentrancyGuard {
    struct Partner {
        string id;
        string name;
        string partnerType; // "Importer" or "Exporter"
        int256 latitude;
        int256 longitude;
        address walletAddress;
        uint256 createdAt;
        bool isActive;
    }

    struct Order {
        string id;
        string supplierId;
        string productId;
        uint256 orderDate;
        uint256 deliveryDate;
        uint256 price;
        bool isPaid;
        string shipmentStatus;
        string requestStatus;
        string carrierId;
        address buyer;
        address supplier;
    }

    mapping(address => Partner) public partners;
    mapping(string => Order) public orders;
    mapping(address => bool) public verifiedPartners;

    event PartnerAdded(string id, address walletAddress);
    event OrderCreated(string id, address buyer, address supplier);
    event OrderStatusUpdated(string id, string status);
    event ShipmentStarted(string orderId, string carrierId);
    event ShipmentCompleted(string orderId);

    modifier onlyVerifiedPartner() {
        require(verifiedPartners[msg.sender], "Not a verified partner");
        _;
    }

    constructor() Ownable(msg.sender) {}

    function addPartner(
        string memory _id,
        string memory _name,
        string memory _type,
        int256 _lat,
        int256 _long
    ) external {
        require(!verifiedPartners[msg.sender], "Partner already exists");

        partners[msg.sender] = Partner({
            id: _id,
            name: _name,
            partnerType: _type,
            latitude: _lat,
            longitude: _long,
            walletAddress: msg.sender,
            createdAt: block.timestamp,
            isActive: true
        });

        verifiedPartners[msg.sender] = true;
        emit PartnerAdded(_id, msg.sender);
    }

    function createOrder(
        string memory _id,
        string memory _supplierId,
        string memory _productId,
        address _supplier
    ) external {
        require(verifiedPartners[msg.sender], "Not a verified partner");

        orders[_id] = Order({
            id: _id,
            supplierId: _supplierId,
            productId: _productId,
            orderDate: block.timestamp,
            deliveryDate: 0,
            price: 0,
            isPaid: false,
            shipmentStatus: "Pending",
            requestStatus: "Pending",
            carrierId: "",
            buyer: msg.sender,
            supplier: _supplier
        });

        emit OrderCreated(_id, msg.sender, _supplier);
    }

    function acceptOrder(
        string memory _orderId,
        uint256 _price,
        uint256 _deliveryDate
    ) external onlyVerifiedPartner {
        Order storage order = orders[_orderId];
        require(msg.sender == order.supplier, "Not the supplier");
        require(keccak256(bytes(order.requestStatus)) == keccak256(bytes("Pending")), "Invalid status");

        order.price = _price;
        order.deliveryDate = _deliveryDate;
        order.requestStatus = "Approved";

        emit OrderStatusUpdated(_orderId, "Approved");
    }

    function startShipment(
        string memory _orderId,
        string memory _carrierId
    ) external payable nonReentrant {
        Order storage order = orders[_orderId];
        require(msg.sender == order.buyer, "Not the buyer");
        require(msg.value == order.price, "Incorrect payment amount");
        require(keccak256(bytes(order.requestStatus)) == keccak256(bytes("Approved")), "Order not approved");

        order.carrierId = _carrierId;
        order.shipmentStatus = "In Transit";
        order.isPaid = true;

        emit ShipmentStarted(_orderId, _carrierId);
    }

    function completeShipment(string memory _orderId) external nonReentrant {
        Order storage order = orders[_orderId];
        require(msg.sender == order.supplier, "Not the supplier");
        require(order.isPaid, "Order not paid");
        require(keccak256(bytes(order.shipmentStatus)) == keccak256(bytes("In Transit")), "Invalid status");

        order.shipmentStatus = "Delivered";
        payable(order.supplier).transfer(order.price);

        emit ShipmentCompleted(_orderId);
    }

    function getPartner(address _address) external view returns (Partner memory) {
        return partners[_address];
    }

    function getOrder(string memory _orderId) external view returns (Order memory) {
        return orders[_orderId];
    }
}

